import React from 'react';
import Main from './Main';
import img1 from '../../../images/Pr-1.png';
import img2 from '../../../images/Pr-2.png';
import img3 from '../../../images/Pr-3.png';


export default function HCJ(){

    const img=[img1,img2,img3];

    return(
        <>
          <div className="hcj">
          {img.map((val,i)=>{
                <Main image={val} />
            })}
          </div>
        </>
    )
}
